import React from "react";
import { Link } from "react-router-dom";

import './ManagerPortal.css';

const ManagerPortal = () => {
    const orders = this.state.orders;
    const dataHtml = orders.map((item, index) => {
      return (
        <tr key={item.id}>
          <td>{item.id}</td>
          <td>{item.service}</td>
          <td>{item.type}</td>
          <td>{item.status}</td>
          <td>
            <button className="order">
              <Link to={`/updateOrder/${item.id}`}>Edit</Link>
            </button>
          </td>
        </tr>
      );
    });
    return (
      <React.Fragment>
      <div class="manager_portal">
        <h1>Welcome to the Manager Portal</h1>

        <div class="links">
          <div class="link">
          <Link to="/EmpRegistration">Register Employee</Link>
          </div>
          <div class="link">
          <Link to="/ServiceRegistration">Register Service</Link>
          </div>
          <div class="link">
          <Link to="/EquipRegistration">Register Equipment</Link>
          </div>
        </div>
      </div>

      <h2> Daily Tasks: </h2>
      <br />

      </React.Fragment>
    );
  }

  export default ManagerPortal;
